import React from 'react';
import './Nav.css'; // Make sure to import your CSS file

const Nav = () => {
  return (
    <nav className="container">
      <div className="flex-item">
        <a href="#">Explore</a>
        <a href="#">Problems</a>
        <a href="#">Context</a>
        <a href="#">Discuss</a>
        <a href="#">Event</a>
      </div>

      <div className="flex-item">
        <button>Premium</button>
        <a href="#">Sign in</a>
        <p>aeati.</p>
        <a href="#">Sign up</a>
      </div>
    </nav>
  );
};

export default Nav;
